    def preprocessMessage(self, message):
        message = message.lower()
        
        message = message.replace("ę","e")
        message = message.replace("ó","o")
        message = message.replace("ą","a")
        message = message.replace("ś","s")
        message = message.replace("ż","z")
        message = message.replace("ź","z")
        message = message.replace("ć","c")
        message = message.replace("ń","n")

        message = message.translate(str.maketrans('', '', string.punctuation)) # TODO maybe not best idea, user can forgot about space after comma

        return message

    def setNick(self, nick):
        self.user_nick = nick

        first_word = nick.split()[0]
        first_word = first_word.lower()

        if first_word[-1] == "a" and first_word != "kuba":
            self.user_gender = Gender.FEMALE

        if first_word[-1] in self.consonants:
            self.user_gender = Gender.MALE

        for key in self.responds:
            for i in range(len(self.responds[key])):
                self.responds[key][i] = self.responds[key][i].replace("{{nick}}", self.user_nick)

                if self.user_gender == Gender.FEMALE:
                    self.responds[key][i] = self.responds[key][i].replace("{{gender_e/a}}", "a")
                else:
                    self.responds[key][i] = self.responds[key][i].replace("{{gender_e/a}}", "e")

    def detectGibberish(self, message):
        words = message.split()
        if any(len(word) > 20 for word in words):
            return True

        if sum(letters in message for letters in self.never_existing_2_letters) > 3:
            return True
        if sum(letters in message for letters in self.never_existing_3_letters) > 3:
            return True

        vowels_count = sum(message.count(vowel) for vowel in self.vowels)
        consonants_count = sum(message.count(consonant) for consonant in self.consonants)

        vowels_count = vowels_count / len(message)
        consonants_count = consonants_count / len(message)

        #if vowels_count < 0.1 or consonants_count < 0.1:
        #    return True

        return False

    def getRespondingBot(self, message):
        for i in range(len(self.bots_names)):
            if self.bots_names[i].lower() in message:
                return self.bots_names[i]

        return random.choice(self.bots_names)

    def generateRepondMessage(self, message, responding_bot, prev_message_id):
        #responding_bot_gender = Gender.MALE

        #if responding_bot[-1] == "a":
        #    responding_bot_gender = Gender.FEMALE

        self.user_messages_counter += 1

        
        if prev_message_id < 5 or prev_message_id > 48:
            return [""]

        if self.user_messages_counter > 50:
            return self.responds["SPAM"]

        if self.detectGibberish(message):
            return self.responds["GIBBERISH"]

        if prev_message_id < 10 or prev_message_id > 46:
            return [""]

        if len(message) > 300:
            return self.responds["TL_DR"]

        if prev_message_id > 11 and prev_message_id < 17 and self.what_should_we_do_counter < 3:
            if any(what_should_we_do_elem in message for what_should_we_do_elem in self.what_should_we_do):
                self.what_should_we_do_counter += 1

                return [self.responds["WHAT_SHOULD_WE_DO"][self.what_should_we_do_counter-1]]
        
        if prev_message_id > 14 and prev_message_id < 40:
            if len(message.split()) < 4:
                return self.responds["EXPLAIN_MORE"]

        if any(question in message.split() for question in self.questions) or "?" in message:
            return self.responds["QUESTION"]

        return self.responds["GENERIC"]

    def generateRespond(self, message, prev_message_id):
        prev_message_id = int(prev_message_id)

        message = self.preprocessMessage(message)
        
        responding_bot = self.getRespondingBot(message)

        responding_message = random.choice(self.generateRepondMessage(message, responding_bot, prev_message_id))

        if self.user_messages_counter % 3 == 0:
            responding_message = ""

        return [
            responding_message,
            responding_bot
        ]
        